import React, { useEffect, useState } from 'react';
import ApiService from '../../../service/ApiService';

const WeatherList = ({search, apiQuery}) => {
  const [items, setItems] = useState([]);

  useEffect(() => {
    ApiService.fetchWeather(apiQuery).then((value) => {
      setItems(value);
    });
  }, [apiQuery]);

  // const filteredItems = items.filter(city => city.name.toLowerCase().includes(search.toLowerCase()))
  return (
    <>
      {items.map(i => {
        <div>i.</div>
      })}
    </>
  );
};

export default WeatherList;
